from typing import Dict, List, Optional, TypeVar, Any, Text
from zerver.lib.integrations import Integration, INTEGRATIONS

class ZapierIntegration(Integration):

    def __init__(self, name: str, categories: Optional[List[str]]=None,
                 display_name: Optional[str]=None, logo: Optional[str]=None,
                 logo_alt: Optional[str]=None) -> None:
        if logo_alt is None:
            logo_alt = "{} logo".format(name.title())
        self.logo_alt = logo_alt

        if logo is None:
            logo = "static/images/integrations/logos/zapier.svg"
        
        if categories is None:
            categories = ['meta-integration']

        super().__init__(
            name, name, categories,
            logo=logo, display_name=display_name,
            doc = 'zerver/integrations/zapier_common.md'
        )

    def is_hidden(self) -> bool:
        return True

